class Vector{x;y;constructor(x,y){this.x=x;this.y=y}get length(){return Math.hypot(this.x,this.y)}set length(v){this.scale(v/this.length)}getLength(){return this.length}setLength(v){this.length=v}scale(s){this.x*=this.y*=s}normalize(){this.length=1}setX(v){this.x=v}setY(v){this.y=v}set(x,y){this.x=x;this.y=y}}export{Vector as default,Vector,Vector as Vec};